import  React, { Component } from "react"
import {ScreenLayouts} from "./FormLayouts"
import { throws } from "assert";
type formId = {
    Id: string
  }
export class FormBuilder extends React.Component<formId> {
    constructor(props){
        super(props);
    }
    render() {
      return (
            <div>
                <h1>this.props.Id</h1>
                <h1>{JSON.stringify(ScreenLayouts[this.props.Id])}</h1>
            </div>
        );
    }
  }
  export default FormBuilder;
